import React from 'react';

function Card(props){

    return(
        <>
        <h1 className="heading">Below is the list of Series</h1>
        <div className = "main_box">
            <div className = "card-box">
                <img src={props.imgscr}/>
                <p>{props.title}</p>
                <h2>{props.sname}</h2>
                <a href={props.link} target ="_blank">Click Me </a>
            </div>
        </div>
        </>
    );

}
export default Card;
